function Pessoa ({nome, idade}) {
    return (
        <div style={styles.fraseContainer}>
            <h1>Olá, seu nome é {nome}</h1>
            <p>Você possui {idade} anos, certo?</p>
        </div>
    )
    
}

export default Pessoa
